import React, { Component } from 'react'
import { Card, Container, Image, Row, Col, Form } from 'react-bootstrap';
import carpooling from '../Images/carpooling.jpg'
import LoginForm from './LoginForm';
import '../App.css'


export default class HomePage extends Component {
    render() {
        return (
            <div>
            <Row>
                <Col xs lg={9}>
                    <Card  fluid style = {{"margin-left": "10px","margin-top":"10px", background:"#FFFFF0"}}>
                        <Card.Title style = {{color:"black", padding:"10px"}}>
                            
                        </Card.Title>
                    </Card>
                </Col>
                <Col>
                    <LoginForm/>
                </Col>
            </Row>
            </div>
        )
    }
}
